contracts/cygnus-oracle/ChainlinkNebulaO.content:
// SPDX-License-Identifier: Unlicensed
pragma solidity ^0.8.4;

// Dependencies
import { IChainlinkNebulaOracle } from "./interfaces/IChainlinkNebulaOracle.sol";
import { ReentrancyGuard } from "./utils/ReentrancyGuard.sol";
import { Context } from "./utils/Context.sol";

// Libraries
import { PRBMath, PRBMathUD60x18 } from "./libraries/PRBMathUD60x18.sol";

// Interfaces
import { AggregatorV3Interface } from "./interfaces/AggregatorV3Interface.sol";
import { IDexPair } from "./interfaces/IDexPair.sol";
import { IErc20 } from "./interfaces/IErc20.sol";

/**
 *  @title  ChainlinkNebulaOracle
 *  @author CygnusDAO
 *  @notice Oracle used by Cygnus that returns the price of 1 LP Token in DAI. In case need
 *          different implementation just update the denomination variable `dai` with another price feed
 *  @notice Implementation of fair lp token pricing using Chainlink price feeds
 *          https://blog.alphaventuredao.io/fair-lp-token-pricing/
 */
contract ChainlinkNebulaOracle is IChainlinkNebulaOracle, Context, ReentrancyGuard {
    /*  ═══════════════════════════════════════════════════════════════════════════════════════════════════════ 
            1. LIBRARIES
        ═══════════════════════════════════════════════════════════════════════════════════════════════════════  */

    /**
     *  @custom:library PRBMathUD60x18 Fixed point 18 decimal math library, imports main library `PRBMath`
     */
    using PRBMathUD60x18 for uint256;

    /*  ═══════════════════════════════════════════════════════════════════════════════════════════════════════ 
            2. STORAGE
        ═══════════════════════════════════════════════════════════════════════════════════════════════════════  */

    /*  ────────────────────────────────────────────── Internal ───────────────────────────────────────────────  */

    /**
     *  @custom:struct ChainlinkNebula Official record of all Chainlink oracles used by Cygnus
     *  @custom:member initialized Whether an LP Token is being tracked or not
     *  @custom:member oracleId The ID of the LP Token tracked by the oracle
     *  @custom:member underlying The address of the LP Token
     *  @custom:member priceFeedA The address of the Chainlink aggregator used for this LP Token's Token0
     *  @custom:member priceFeedB The address of the Chainlink aggregator used for this LP Token's Token1
     */
    struct ChainlinkNebula {
        bool initialized;
        uint24 oracleId;
        address underlying;
        AggregatorV3Interface priceFeedA;
        AggregatorV3Interface priceFeedB;
    }

    /*  ─────────────────────────────────────────────── Public ────────────────────────────────────────────────  */

    /**
     *  @inheritdoc IChainlinkNebulaOracle
     */
    mapping(address => ChainlinkNebula) public override getNebula;

    /**
     *  @inheritdoc IChainlinkNebulaOracle
     */
    address[] public override allNebulas;

    /**
     *  @inheritdoc IChainlinkNebulaOracle
     */
    string public constant override name = "Cygnus-Chainlink: LP Oracle";

    /**
     *  @inheritdoc IChainlinkNebulaOracle
     */
    string public constant override symbol = "CygNebula";

    /**
     *  @inheritdoc IChainlinkNebulaOracle
     */
    uint8 public constant override decimals = 18;

    /**
     *  @inheritdoc IChainlinkNebulaOracle
     */
    uint8 public constant override version = 1;

    /**
     *  @inheritdoc IChainlinkNebulaOracle
     */
    AggregatorV3Interface public immutable override dai;

    /**
     *  @inheritdoc IChainlinkNebulaOracle
     */
    address public override admin;

    /**
     *  @inheritdoc IChainlinkNebulaOracle
     */
    address public override pendingAdmin;

    /*  ═══════════════════════════════════════════════════════════════════════════════════════════════════════ 
            3. CONSTRUCTOR
        ═══════════════════════════════════════════════════════════════════════════════════════════════════════  */

    /**
     *  @notice Constructs the Oracle
     *  @param priceDenominator The denomination token this oracle returns the price in
     */
    constructor(AggregatorV3Interface priceDenominator) {
        // Assign admin
        admin = _msgSender();

        // Assign the denomination the LP Token will be priced in
        dai = AggregatorV3Interface(priceDenominator);
    }

    /*  ═══════════════════════════════════════════════════════════════════════════════════════════════════════ 
            4. MODIFIERS
        ═══════════════════════════════════════════════════════════════════════════════════════════════════════  */

    /**
     *  @custom:modifier cygnusAdmin Modifier for admin control only 👽
     */
    modifier cygnusAdmin() {
        isCygnusAdmin();
        _;
    }

    /*  ═══════════════════════════════════════════════════════════════════════════════════════════════════════ 
            5. CONSTANT FUNCTIONS
        ═══════════════════════════════════════════════════════════════════════════════════════════════════════  */

    /*  ────────────────────────────────────────────── Internal ───────────────────────────────────────────────  */

    /**
     *  @notice Internal check for admin control only 👽
     */
    function isCygnusAdmin() internal view {
        /// @custom:error MsgSenderNotAdmin Avoid unless caller is Cygnus Admin
        if (_msgSender() != admin) {
            revert ChainlinkNebulaOracle__MsgSenderNotAdmin(_msgSender());
        }
    }

    /*  ─────────────────────────────────────────────── Public ────────────────────────────────────────────────  */

    /**
     *  @inheritdoc IChainlinkNebulaOracle
     */
    function nebulaSize() public view override returns (uint24) {
        // Return how many LP Tokens we are tracking
        return uint24(allNebulas.length);
    }

    /*  ────────────────────────────────────────────── External ───────────────────────────────────────────────  */

    /**
     *  @inheritdoc IChainlinkNebulaOracle
     */
    function daiPrice() external view override returns (uint256 latestPriceDai) {
        // Chainlink price feed for the LP denomination token, in our case DAI
        (, int256 latestDaiPrice, , , ) = dai.latestRoundData();

        // Adjust dai price to 18 decimals and return price
        latestPriceDai = uint256(latestDaiPrice) * 10**(decimals - dai.decimals());
    }

    /**
     *  @inheritdoc IChainlinkNebulaOracle
     */
    function lpTokenPriceDai(address lpTokenPair) external view override returns (uint256 lpTokenPrice) {
        // Load to memory
        ChainlinkNebula memory cygnusNebula = getNebula[lpTokenPair];

        /// custom:error PairNotInitialized Avoid getting price unless lpTokenPair's price is being tracked
        if (!cygnusNebula.initialized) {
            revert ChainlinkNebulaOracle__PairNotInitialized(lpTokenPair);
        }

        // 1. Get reserves of Token A and Token B to compute k
        (
            uint112 reservesTokenA,
            uint112 reservesTokenB, /* Timestamp */

        ) = IDexPair(lpTokenPair).getReserves();

        // 2. Get total supply of the underlying LP Token
        uint256 totalSupply = IDexPair(lpTokenPair).totalSupply();

        // Adjust reserves Token A
        uint256 adjustedReservesA = reservesTokenA *
            (10**(decimals - IErc20(IDexPair(lpTokenPair).token0()).decimals()));

        // Adjust reserves Token B
        uint256 adjustedReservesB = reservesTokenB *
            (10**(decimals - IErc20(IDexPair(lpTokenPair).token1()).decimals()));

        // 3. Geometric mean of reservesA and reservesB
        uint256 productReserves = adjustedReservesA.gm(adjustedReservesB);

        // Chainlink price feed for this lpTokens token0
        (, int256 priceA, , , ) = cygnusNebula.priceFeedA.latestRoundData();

        // Chainlink price feed for this lpTokens token1
        (, int256 priceB, , , ) = cygnusNebula.priceFeedB.latestRoundData();

        // Chainlink price feed for denomination token, in cygnus' case DAI
        (, int256 latestDaiPrice, , , ) = dai.latestRoundData();

        // Adjust price Token A to 18 decimals
        uint256 adjustedPriceA = uint256(priceA) * 10**(decimals - cygnusNebula.priceFeedA.decimals());

        // Adjust price Token B to 18 decimals
        uint256 adjustedPriceB = uint256(priceB) * 10**(decimals - cygnusNebula.priceFeedB.decimals());

        // Adjust dai price to 18 decimals
        uint256 adjustedDaiPrice = uint256(latestDaiPrice) * 10**(decimals - dai.decimals());

        // 4. Geometric mean of priceA and priceB
        uint256 productPrice = adjustedPriceA.gm(adjustedPriceB);

        // LP Token price denominated in USD
        uint256 lpTokenPriceUSD = PRBMath.mulDiv(productReserves, productPrice, totalSupply) * 2;

        // 5. Return LP Token price denominated in DAI
        lpTokenPrice = lpTokenPriceUSD.div(adjustedDaiPrice);
    }

    /**
     *  @inheritdoc IChainlinkNebulaOracle
     */
    function assetPricesDai(address lpTokenPair)
        external
        view
        override
        returns (uint256 tokenPriceA, uint256 tokenPriceB)
    {
        // Load to memory
        ChainlinkNebula memory cygnusNebula = getNebula[lpTokenPair];

        /// custom:error PairNotInitialized Avoid getting price unless lpTokenPair's price is being tracked
        if (!cygnusNebula.initialized) {
            revert ChainlinkNebulaOracle__PairNotInitialized(lpTokenPair);
        }

        // Chainlink price feed for this lpTokens token0
        (, int256 priceA, , , ) = cygnusNebula.priceFeedA.latestRoundData();

        // Chainlink price feed for this lpTokens token1
        (, int256 priceB, , , ) = cygnusNebula.priceFeedB.latestRoundData();

        // Chainlink price feed for denomination token, in cygnus' case DAI
        (, int256 latestDaiPrice, , , ) = dai.latestRoundData();

        // Adjust price Token A to 18 decimals
        uint256 adjustedPriceA = uint256(priceA) * 10**(decimals - cygnusNebula.priceFeedA.decimals());

        // Adjust price Token B to 18 decimals
        uint256 adjustedPriceB = uint256(priceB) * 10**(decimals - cygnusNebula.priceFeedB.decimals());

        // Adjust dai price to 18 decimals
        uint256 adjustedDaiPrice = uint256(latestDaiPrice) * 10**(decimals - dai.decimals());

        // Return token0's price in DAI
        tokenPriceA = adjustedPriceA.div(adjustedDaiPrice);

        // Return token1's price in DAI
        tokenPriceB = adjustedPriceB.div(adjustedDaiPrice);
    }

    /*  ═══════════════════════════════════════════════════════════════════════════════════════════════════════ 
            6. NON-CONSTANT FUNCTIONS
        ═══════════════════════════════════════════════════════════════════════════════════════════════════════  */

    /*  ────────────────────────────────────────────── External ───────────────────────────────────────────────  */

    /**
     *  @inheritdoc IChainlinkNebulaOracle
     *  @custom:security non-reentrant
     */
    function initializeNebula(
        address lpTokenPair,
        AggregatorV3Interface aggregatorA,
        AggregatorV3Interface aggregatorB
    ) external override cygnusAdmin nonReentrant {
        // Load to storage
        ChainlinkNebula storage cygnusNebula = getNebula[lpTokenPair];

        /// @custom:error PairIsinitialized Avoid duplicate oracle
        if (cygnusNebula.initialized) {
            revert ChainlinkNebulaOracle__PairAlreadyInitialized(lpTokenPair);
        }

        // Assign id
        cygnusNebula.oracleId = nebulaSize();

        // Store LP Token address
        cygnusNebula.underlying = lpTokenPair;

        // Store the chainlink's aggregator contract address for this LP Token's token0
        cygnusNebula.priceFeedA = aggregatorA;

        // Store the chainlink's aggregator contract address for this LP Token's token1
        cygnusNebula.priceFeedB = aggregatorB;

        // Store oracle status
        cygnusNebula.initialized = true;

        // Add to list
        allNebulas.push(lpTokenPair);

        /// @custom:event InitializeChainlinkNebula
        emit InitializeChainlinkNebula(true, cygnusNebula.oracleId, lpTokenPair, aggregatorA, aggregatorB);
    }

    /**
     *  @inheritdoc IChainlinkNebulaOracle
     *  @custom:security non-reentrant
     */
    function deleteNebula(address lpTokenPair) external override cygnusAdmin nonReentrant {
        /// @custom:error PairNotinitialized Avoid delete if not initialized
        if (!getNebula[lpTokenPair].initialized) {
            revert ChainlinkNebulaOracle__PairNotInitialized(lpTokenPair);
        }

        // Get the index of this oracle
        uint24 oracleId = getNebula[lpTokenPair].oracleId;

        // Get the first price feed for this oracle
        AggregatorV3Interface priceFeedA = getNebula[lpTokenPair].priceFeedA;

        // Get the second price feed for this oracle
        AggregatorV3Interface priceFeedB = getNebula[lpTokenPair].priceFeedB;

        // Delete from array and leave a gap as to not mix up IDs
        delete allNebulas[oracleId];

        // Delete from object
        delete getNebula[lpTokenPair];

        /// @custom:event DeleteChainlinkNebula
        emit DeleteChainlinkNebula(oracleId, lpTokenPair, priceFeedA, priceFeedB, _msgSender());
    }

    /**
     *  @inheritdoc IChainlinkNebulaOracle
     *  @custom:security non-reentrant
     */
    function setOraclePendingAdmin(address newOracleAdmin) external override cygnusAdmin nonReentrant {
        // Pending admin initial is always zero
        /// @custom:error PendingAdminAlreadySet Avoid setting the same pending admin twice
        if (newOracleAdmin == pendingAdmin) {
            revert ChainlinkNebulaOracle__PendingAdminAlreadySet(newOracleAdmin);
        }

        // Assign address of the requested admin
        pendingAdmin = newOracleAdmin;

        /// @custom:event NewOraclePendingAdmin
        emit NewOraclePendingAdmin(admin, newOracleAdmin);
    }

    /**
     *  @inheritdoc IChainlinkNebulaOracle
     *  @custom:security non-reentrant
     */
    function setOracleAdmin() external override cygnusAdmin nonReentrant {
        /// @custom:error AdminCantBeZero Avoid settings the admin to the zero address
        if (pendingAdmin == address(0)) {
            revert ChainlinkNebulaOracle__AdminCantBeZero(pendingAdmin);
        }

        // Address of the Admin up until now
        address oldAdmin = admin;

        // Assign new admin
        admin = pendingAdmin;

        // Gas refund
        delete pendingAdmin;

        // @custom:event NewOracleAdmin
        emit NewOracleAdmin(oldAdmin, admin);
    }
}

contracts/cygnus-oracle/interfaces/IChai.content:
// SPDX-License-Identifier: Unlicensed
pragma solidity ^0.8.4;

import { AggregatorV3Interface } from "./AggregatorV3Interface.sol";
import { IDexPair } from "./IDexPair.sol";

/**
 *  @title IChainlinkNebulaOracle Interface to interact with Cygnus' Chainlink oracle
 */
interface IChainlinkNebulaOracle {
    /*  ═══════════════════════════════════════════════════════════════════════════════════════════════════════ 
            1. CUSTOM ERRORS
        ═══════════════════════════════════════════════════════════════════════════════════════════════════════  */

    /**
     *  @custom:error PairIsInitialized Emitted when attempting to initialize an already initialized LP Token
     */
    error ChainlinkNebulaOracle__PairAlreadyInitialized(address lpTokenPair);

    /**
     *  @custom:error PairNotInitialized Emitted when attempting to get the price of an LP Token that is not initialized
     */
    error ChainlinkNebulaOracle__PairNotInitialized(address lpTokenPair);

    /**
     *  @custom:error MsgSenderNotAdmin Emitted when attempting to access admin only methods
     */
    error ChainlinkNebulaOracle__MsgSenderNotAdmin(address msgSender);

    /**
     *  @custom:error AdminCantBeZero Emitted when attempting to set the admin if the pending admin is the zero address
     */
    error ChainlinkNebulaOracle__AdminCantBeZero(address pendingAdmin);

    /**
     *  @custom:error PendingAdminAlreadySet Emitted when attempting to set the same pending admin twice
     */
    error ChainlinkNebulaOracle__PendingAdminAlreadySet(address pendingAdmin);

    /*  ═══════════════════════════════════════════════════════════════════════════════════════════════════════ 
            2. CUSTOM EVENTS
        ═══════════════════════════════════════════════════════════════════════════════════════════════════════  */

    /**
     *  @notice Logs when a new LP Token is added to this oracle and the price is being tracked
     *  @param initialized Whether or not the LP Token is initialized
     *  @param oracleId The ID for this oracle
     *  @param lpTokenPair The address of the LP Token
     *  @param priceFeedA The address of the Chainlink's aggregator contract for this LP Token's token0
     *  @param priceFeedB The address of the Chainlink's aggregator contract for this LP Token's token1
     *  @custom:event InitializeChainlinkNebula Emitted when an LP Token pair's price starts being tracked
     */
    event InitializeChainlinkNebula(
        bool initialized,
        uint24 oracleId,
        address lpTokenPair,
        AggregatorV3Interface priceFeedA,
        AggregatorV3Interface priceFeedB
    );

    /**
     *  @notice Logs when an LP Token is removed from this oracle, rendering all calls on this LP Token null
     *  @param oracleId The ID for this oracle
     *  @param lpTokenPair The contract address of the LP Token
     *  @param priceFeedA The contract address of Chainlink's aggregator contract for this LP Token's token0
     *  @param priceFeedB The contract address of the Chainlink's aggregator contract for this LP Token's token1
     *  @custom:event DeleteChainlinkNebula Emitted when an LP Token pair is removed from this oracle
     */
    event DeleteChainlinkNebula(
        uint24 oracleId,
        address lpTokenPair,
        AggregatorV3Interface priceFeedA,
        AggregatorV3Interface priceFeedB,
        address msgSender
    );

    /**
     *  @notice Logs when a new pending admin for the oracle is set
     *  @param oracleCurrentAdmin The address of the current oracle admin
     *  @param oraclePendingAdmin The address of the pending oracle admin
     *  @custom:event NewNebulaPendingAdmin Emitted when a new pending admin is set, to be accepted by admin
     */
    event NewOraclePendingAdmin(address oracleCurrentAdmin, address oraclePendingAdmin);

    /**
     *  @notice Logs when a new admin for the oracle is confirmed
     *  @param oracleOldAdmin The address of the old oracle admin
     *  @param oracleNewAdmin The address of the new oracle admin
     *  @custom:event NewNebulaAdmin Emitted when the pending admin is confirmed as the new oracle admin
     */
    event NewOracleAdmin(address oracleOldAdmin, address oracleNewAdmin);

    /*  ═══════════════════════════════════════════════════════════════════════════════════════════════════════ 
            3. CONSTANT FUNCTIONS
        ═══════════════════════════════════════════════════════════════════════════════════════════════════════  */

    /*  ─────────────────────────────────────────────── Public ────────────────────────────────────────────────  */

    /**
     *  @notice Returns the struct record of each oracle used by Cygnus
     *  @param lpTokenPair The address of the LP Token
     *  @return initialized Whether an LP Token is being tracked or not
     *  @return oracleId The ID of the LP Token tracked by the oracle
     *  @return underlying The address of the LP Token
     *  @return priceFeedA The address of the Chainlink aggregator used for this LP Token's Token0
     *  @return priceFeedB The address of the Chainlink aggregator used for this LP Token's Token1
     */
    function getNebula(address lpTokenPair)
        external
        view
        returns (
            bool initialized,
            uint24 oracleId,
            address underlying,
            AggregatorV3Interface priceFeedA,
            AggregatorV3Interface priceFeedB
        );

    /**
     *  @notice Gets the address of the LP Token that (if) is being tracked by this oracle
     *  @param id The ID of each LP Token that is being tracked by this oracle
     *  @return The address of the LP Token if it is being tracked by this oracle, else returns address zero
     */
    function allNebulas(uint256 id) external view returns (address);

    /**
     *  @return The name for this Cygnus-Chainlink Nebula oracle
     */
    function name() external view returns (string memory);

    /**
     *  @return The decimals for this Cygnus-Chainlink Nebula oracle
     */
    function decimals() external view returns (uint8);

    /**
     *  @return The symbol for this Cygnus-Chainlink Nebula oracle
     */
    function symbol() external view returns (string memory);

    /**
     *  @return The address of Chainlink's DAI oracle
     */
    function dai() external view returns (AggregatorV3Interface);

    /**
     *  @return The address of the Cygnus admin
     */
    function admin() external view returns (address);

    /**
     *  @return The address of the new requested admin
     */
    function pendingAdmin() external view returns (address);

    /**
     *  @return The version of this oracle
     */
    function version() external view returns (uint8);

    /**
     *  @return How many LP Token pairs' prices are being tracked by this oracle
     */
    function nebulaSize() external view returns (uint24);

    /*  ────────────────────────────────────────────── External ───────────────────────────────────────────────  */

    /**
     *  @return The price of DAI with 18 decimals
     */
    function daiPrice() external view returns (uint256);

    /**
     *  @notice Gets the latest price of the LP Token denominated in DAI
     *  @notice LP Token pair must be initialized, else reverts with custom error
     *  @param lpTokenPair The address of the LP Token
     *  @return lpTokenPrice The price of the LP Token denominated in DAI
     */
    function lpTokenPriceDai(address lpTokenPair) external view returns (uint256 lpTokenPrice);

    /**
     *  @notice Gets the latest price of the LP Token's token0 and token1 denominated in DAI
     *  @notice Used by Cygnus Altair contract to calculate optimal amount of leverage
     *  @param lpTokenPair The address of the LP Token
     *  @return tokenPriceA The price of the LP Token's token0 denominated in DAI
     *  @return tokenPriceB The price of the LP Token's token1 denominated in DAI
     */
    function assetPricesDai(address lpTokenPair) external view returns (uint256 tokenPriceA, uint256 tokenPriceB);

    /*  ═══════════════════════════════════════════════════════════════════════════════════════════════════════ 
            4. NON-CONSTANT FUNCTIONS
        ═══════════════════════════════════════════════════════════════════════════════════════════════════════  */

    /*  ────────────────────────────────────────────── External ───────────────────────────────────────────────  */

    /**
     *  @notice Initialize an LP Token pair, only admin
     *  @param lpTokenPair The contract address of the LP Token
     *  @param priceFeedA The contract address of the Chainlink's aggregator contract for this LP Token's token0
     *  @param priceFeedB The contract address of the Chainlink's aggregator contract for this LP Token's token1
     *  @custom:security non-reentrant
     */
    function initializeNebula(
        address lpTokenPair,
        AggregatorV3Interface priceFeedA,
        AggregatorV3Interface priceFeedB
    ) external;

    /**
     *  @notice Deletes an LP token pair from the oracle
     *  @notice After deleting, any call from a shuttle deployed that is using this pair will revert
     *  @param lpTokenPair The contract address of the LP Token to remove from the oracle
     *  @custom:security non-reentrant
     */
    function deleteNebula(address lpTokenPair) external;

    /**
     *  @notice Sets a new pending admin for the Oracle
     *  @param newOraclePendingAdmin Address of the requested Oracle Admin
     */
    function setOraclePendingAdmin(address newOraclePendingAdmin) external;

    /**
     *  @notice Sets a new admin for the Oracle
     */
    function setOracleAdmin() external;
}

